// Becareful when changing, this is not strict typesafe
func saveCountry(ctx context.Context, entClient *ent.Client, countryData map[string]interface{}) error {
	// Check if the country already exists by iso2
	exists, err := entClient.Country.Query().
		Where(country.Iso2EQ(countryData["iso2"].(string))).
		Exist(ctx)
	if err != nil {
		return fmt.Errorf("failed to check if country exists: %w", err)
	}

	if exists {
		return nil
	}

	// Insert the new country
	_, err = entClient.Country.Create().
		SetName(countryData["name"].(string)).
		SetOfficialName(countryData["official_name"].(string)).
		SetIso2(countryData["iso2"].(string)).
		SetIso3(countryData["iso3"].(string)).
		SetNumericCode(countryData["numeric_code"].(string)).
		SetPhoneCode(countryData["phone_code"].(string)).
		SetCapital(countryData["capital"].(string)).
		SetCurrencyName(countryData["currency_name"].(string)).
		SetCurrencyCode(countryData["currency_code"].(string)).
		SetCurrencySymbol(countryData["currency_symbol"].(string)).
		Save(ctx)
	if err != nil {
		return fmt.Errorf("failed to save country: %w", err)
	}

	return nil
}
